import { Item, Status, AvatarImg, Name } from './FriendsItem.syled';

export function Friend(props) {
  console.log(props);
  const { avatar, name, isOnline } = props;
  return (
    <Item>
      <Status isOnline={isOnline}></Status>
      <AvatarImg src={avatar} alt={name} width="48" />
      <Name>{name}</Name>
    </Item>
  );
}
